import React from 'react';

const Vehicleradio = () => {
  return (
    <div>
      <span class={(this.props.vehicle.name <=0) ? 'avail' : ''}>
          <input type="radio" id={this.vehicleID} name={this.props.groupid} 
            value={this.props.vehicle.name} />
